  \"A High Order Accuracy Computational Tool for Unsteady Turbulent Flows and Acoustics
  Project\",\n\t\"tracking_summary\": {\n\t\t\"total\": 2,\n\t\t\"recent\": 1\n\t},\n\t\"groups\":
  [],\n\t\"relationships_as_subject\": [],\n\t\"revision_timestamp\": \"2015-05-07T03:31:40.085147\",\n\t\"name\":
  \"a-high-order-accuracy-computational-tool-for-unsteady-turbulent-flows-and-acoustics-projec\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"The main objective of this research effort
  is to develop a higher order unsteady turbulent flow solver based on the FDV method,
  and to exploit its attributes of spanning the whole Mach number range.rnrnThe well
  known advantages of the implicit FEM will be inherited along with robust boundary
  conditions implementation and sound mathematical bases. Efficient parallelization,
  using MPI through domain decomposition and EBE solution, and supporting unstructured
  grids will make this effort a long-term investment tool, since all these gained
  advantages are desirable in virtually every NASA aerodynamics application.rnTo this
  end, modularization of the in-house developed computer code will be extended to
  support higher order elements, namely; quadratic, cubic, and eventually spectral
  elements. The developed higher order code will be tested at various flow conditions
  starting from the incompressible limitrnto high supersonics, and including subsonics
  and transonics.\",\n\t\"license_title\": \"U.S. Government Work\",\n\t\"extras\":
